import styled from "styled-components";
import MainSecLeft from "./MainSecLeft";
import MainSecRight from "./MainSecRight";
import { GlobalSection } from "../../stylesGlobal";

GlobalSection = styled(GlobalSection)`
    width: 100%;
    margin: 0 auto;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    
    background-color: #F5F5F5;
`

const SectionNameLogo = styled.section`
    width: 100%;
    margin: 0 auto;
    display: flex;
    align-items: center;
    justify-content: center;
    
`

const DivContainer = styled.div`
    width: 100%;
    margin: 0 auto;
    display: flex;
    align-items: center;
    justify-content: center;
`


function Section01(){
    return (
        <SectionNameLogo>
            <DivContainer>
                <MainSecLeft />
                <MainSecRight />
            </DivContainer>
        </SectionNameLogo>
    )
}

export default Section01
